import { 
    MARKET_GET_SUCCESS,
    MARKET_GET_FAILURE
} from "../actions/ActionTypes";


const InitialState = {
    postlist: [],
    isGetSuccess: false
}

export default function market (state = InitialState, action) {

    switch (action.type) {
        case MARKET_GET_SUCCESS:
            return {
                ...state,
                postlist: action.postlist,
                isGetSuccess: true
            }

        case MARKET_GET_FAILURE:
            return {
                ...state,
                isGetSuccess: false
            }

        default:
            return state;
    }
}
